import './App.css';
import brain from './icons8-brain-96.png';


function App() {
  return (
    <div className="App">
      <div className='navigation'>Sign-In</div>
      <div className='logoContainer'>
        <div className='logo'>
          <span className='glassmorph'><img alt='brain logo' src={brain} width='100px' height='auto'/></span>
        </div>
      </div>
      <div className='input'>
      <input type='text'/><br/>
      <input type='button'/><br/>
      </div>
    </div>
  );
}

export default App;
